INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (13, 'حجز تمريض', 'للاسف التمريض غير موجود حاليا بالفرع ممكن احجز لحضرتك موعد للخروج فور رجوعه', 'HIGH', True, '2025-11-21 20:42:11.392000+02:00', '2025-11-21 21:06:54.861000+02:00', 22, 22);
INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (14, 'عميل جديد او كود', 'استأذن حضرتك رقم التليفون المسجل عليه الخدمة لو اول مرة تشرفنا بالتواصل ممكن اتشرف ببيانات حضرتك لتسجيل كود الاسم : رقم الموبيل : المنطقة /المجموعه : الشارع /رقم العمارة : الدور/رقم الشقه :', 'HIGH', True, '2025-11-21 20:42:11.548000+02:00', '2025-11-21 21:06:54.942000+02:00', 22, 22);
INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (15, 'اعتذار شكوي او تاخير', 'بعتذر جدا لحضرتك علي الخطأ الغير مقصود وتم تسجيل شكوي لحضرتك بالامر للمراجعه وعدم التكرار', 'HIGH', True, '2025-11-21 20:42:11.612000+02:00', '2025-11-21 21:06:55.023000+02:00', 22, 22);
