INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (41, 'فتح استشارة', 'السن كام سنة ؟ - امتي بدأت الأعراض و هل أخدنا اي علاج ليها ؟ - هل فيه حمل أو رضاعه ؟', 'LOW', True, '2025-11-21 20:42:13.712000+02:00', '2025-11-21 21:06:57.183000+02:00', 22, 22);
