INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (43, 'مرتجع', 'سيتم تخصيم قيمة المرتجع مع الاوردر التالي لحضرتك في خلال ١٤ يوم أو يمكنك زيارة اقرب فرع لحضرتك في اي وقت للفحص فى حالة الرغبة فى احضار المرتجع فى الوقت الحالى سيتم تحصيل قيمة التوصيل 7 ج', 'LOW', True, '2025-11-21 20:42:13.873000+02:00', '2025-11-21 21:06:57.350000+02:00', 22, 22);
