INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (46, 'خدمة التوصيل', 'تم اضافه خدمة التوصيل لضمان الحفاظ على افضل مستوى خدمة نقدمه لسيادتكم بجانب الاستفاده من الخدمات الاخرى مثل الاستشارات الطبيه والتجميليه والتمريض المنزلى', 'LOW', True, '2025-11-21 20:42:14.088000+02:00', '2025-11-21 21:06:57.573000+02:00', 22, 22);
