INSERT INTO "global_templates" (id, name, content, category, is_active, created_at, updated_at, created_by_id, updated_by_id) VALUES (54, 'تحويل ماسنجر لواتساب', 'عميلنا العزيز لتفاصيل اكثر والتحدث مع قسم المبيعات او الاستشارات الطبيه يرجي التواصل علي ارقامنا من خلال الرقم الموحد 19045 او من خلال الواتساب 24ساعه بالضغط علي اللينك', 'LOW', True, '2025-11-21 20:42:14.727000+02:00', '2025-11-21 21:06:58.181000+02:00', 22, 22);
